import React from 'react';
import './App.css';
import Navigation from "./component/Navigation/Navigation";
import Products from "./component/Products/Products";
import Footer from "./component/Footer/Footer";
import AddProduct from "./component/Products/AddProduct/AddProduct";
import {Route} from "react-router-dom";
import Welcome from "./component/Welcome/Welcome";
import Notification from "./component/Notification/Notification";
import {useSelector} from "react-redux";
import Print from "./component/Print/Print";
import Login from "./component/Login/Login";
import {StorageKey} from "./types/storage-key";
import Logout from "./component/Logout/Logout";

function App() {

  const notification = useSelector((state: any) => state.ui.notification);

  const userAction = () => {
    const token = localStorage.getItem(StorageKey);
    console.log(token)
    return token
      ? (<Logout />)
      : (<Route path="/login"><Login /></Route>)
  }

  return (
    <div className="App">
      <Navigation />
      <div  className="container">
        {notification && <Notification status={notification.status} title={notification.title} message={notification.message} />}
        <Route path="/" exact><Welcome /></Route>
        <Route path="/list"><Products /></Route>
        <Route path="/add"><AddProduct /></Route>
        <Route path="/print"><Print /></Route>
        {userAction()}
      </div>
      <Footer />
    </div>
  );
}

export default App;
